      {isLogin && (
        <>
          <Header />
          <div className="homeContainer">
            <Featured />
            <h1 className="homeTitle">Browse by property type</h1>
            <PropertyList />
            <h1 className="homeTitle">Homes guests love</h1>
            <FeaturedProperties hotels={hotels} />
            <MailList />
            <Footer />
          </div>
        </>
      )}
      {!isLogin && <AuthenForm onSubmit={onSubmit} />}
    </div>
  );
};

export default Home;
